import React, { Component } from "react";
import { connect } from "react-redux";
import {
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBCardTitle,
  MDBCardText,
  MDBRow,
  MDBCol,
  MDBBtn,
  MDBRating,
  MDBIcon,
} from "mdbreact";

export class saloncontainer extends Component {
  render() {
    return (
      <div className="bg">
        <MDBInputGroup
          material
          hint="Recipient's username"
          containerClassName="mb-4 mt-0"
          append={
            <>
              <MDBBtn color="primary" className="m-0 px-3 py-2 z-depth-1">
                BUTTON
              </MDBBtn>
              <MDBBtn color="primary" className="m-0 px-3 py-2 z-depth-1">
                BUTTON
              </MDBBtn>
            </>
          }
        />
      </div>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(saloncontainer);

